// StockList.js
import React from "react";
import ListGroup from "react-bootstrap/ListGroup";

const StockList = ({ stocks, onSelect }) => {
  return (
    <ListGroup>
      {stocks.map((stock) => (
        <ListGroup.Item
          key={stock.ticker}
          action
          onClick={() => onSelect(stock.ticker)}
        >
          {stock.ticker}
        </ListGroup.Item>
      ))}
    </ListGroup>
  );
};

export default StockList;
